import React from 'react';

export function testComponent(){
    return (
        <>
            <p>Welcome to Patrick Wenzel's 'Hello World App'</p>
            <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
            >
                Visit Our Team's Website
            </a>
        </>
    )
}
